create table sys_data_dict
(
    id          varchar(100) charset utf8 not null comment 'ID'
        primary key,
    dict_type   varchar(50) charset utf8  not null comment '字典类型',
    name        varchar(50) charset utf8  not null comment '字典名称',
    code        varchar(50) charset utf8  not null comment '字典编码',
    value       varchar(100) charset utf8 not null comment '字典值',
    sort        int                       not null comment '排序',
    parent_id   varchar(100) charset utf8 null comment '父类别ID',
    is_root     int default 0             not null comment '是否根结点',
    create_by   varchar(100) charset utf8 null comment '创建人',
    update_by   varchar(100) charset utf8 null comment '更新人',
    create_time datetime                  null comment '创建时间',
    update_time datetime                  null comment '更新时间',
    deleted     int default 0             null comment '是否删除'
)
    comment '数据字典表';

