create table sys_log
(
    id             varchar(100)  not null comment 'ID'
        primary key,
    handle_name    varchar(100)  null comment '操作名称',
    handle_desc    varchar(100)  null comment '操作描述',
    ip_address     varchar(100)  null comment 'ip地址',
    ip_area        varchar(100)  null comment '所属地区',
    browser        varchar(100)  null comment '浏览器',
    application    varchar(100)  null comment '设备',
    request_path   varchar(100)  null comment '请求路径',
    request_method varchar(500)  null comment '请求类型',
    request_param  text          null comment '请求参数',
    request_time   datetime      null comment '请求时间',
    method         varchar(100)  null comment '请求类方法',
    execute_status int           null comment '执行状态',
    execute_time   int           null comment '执行耗时',
    response_data  text          null comment '返回数据',
    error_desc     text          null comment '异常内容',
    username       varchar(100)  null comment '操作用户',
    create_by      varchar(100)  null comment '创建人',
    update_by      varchar(100)  null comment '更新人',
    create_time    datetime      null comment '创建时间',
    update_time    datetime      null comment '更新时间',
    deleted        int default 0 null comment '是否删除'
)
    comment '系统操作日志表';

