create table sys_permission_action
(
    id          varchar(100)  not null comment 'ID'
        primary key,
    name        varchar(100)  null comment '动作名称',
    code        varchar(100)  null comment '权限标识',
    description varchar(100)  null comment '描述',
    group_id    varchar(100)  null comment '所属权限组',
    sort        int default 0 null comment '排序',
    status      int default 0 null comment '状态',
    create_by   varchar(100)  null comment '创建人',
    update_by   varchar(100)  null comment '更新人',
    create_time datetime      null comment '创建时间',
    update_time datetime      null comment '更新时间',
    deleted     int default 0 null comment '是否删除'
)
    comment '系统权限动作表';

