create table tb_blog
(
    id          varchar(100)  not null comment 'ID'
        primary key,
    title       varchar(100)  null comment '文章名称',
    intro       varchar(200)  null comment '摘要',
    category    varchar(100)  null comment '类别',
    tag         varchar(100)  null comment '标签',
    cover       varchar(150)  null comment '封面',
    source      int default 1 null comment '文章来源',
    content     text          null comment '文章内容',
    status      int default 0 null comment '状态',
    visible     int default 0 null comment '仅自己可见',
    author      varchar(100)  null comment '作者',
    create_by   varchar(100)  null comment '创建人',
    update_by   varchar(100)  null comment '更新人',
    create_time datetime      null comment '创建时间',
    update_time datetime      null comment '更新时间',
    deleted     int default 0 null comment '是否删除'
)
    comment '博客文章表';

